        the ''lexicon of risk'' to social response to change.\u000d\u000aJO  - Island
        Studies Journal\u000d\u000aJF  - Island Studies Journal\u000d\u000aY1  - 2017\/05\/\/\u000d\u000aVL  -
        12\u000d\u000aIS  - 1\u000d\u000aM3  - Article\u000d\u000aSP  - 53\u000d\u000aEP  -
        70\u000d\u000aPB  - Island Studies Journal\u000d\u000aSN  - 17152593\u000d\u000aAB  -
        The climate change vulnerability discourse in the Maldives coexists with a
        pervasive set of critical environmental factors of significance to the socio-environmental
        systems of small peripheral islands. This implies the need to strike a balance
        between global challenges associated with environmental processes at the supra-national
        scale and the adjustments and strategies implemented at the local scale in
        response to change. The current paper offers a discussion of this dialectic,
        in reference to both the broader contemporary debate in island studies, and
        the political and environmental context of the Maldives. We first outline
        the international scenario, and then go on, in the second part of the paper,
        to provide a reading of environmental policy on these islands. We argue that
        emphasizing the country''s environmental vulnerability has reinforced a ''lexicon
        of risk'' within the environmental discourse and that, in recent years, this
        narrative has been one of the main forces driving the construction of contemporary
        Maldivian ''nation-ness''. [ABSTRACT FROM AUTHOR]\u000d\u000aAB  - Copyright
